let ipUrl = "http://127.0.0.1:7002/default/";
const servicePath = {
  getArticleList: ipUrl + "getArticleList",
  getArticleById: ipUrl + "getArticleById/",
  getTypeInfo: ipUrl + "getTypeInfo"
};
export default servicePath;
